;; **
;;; # Adaptive evolution
;;; 
;;; This worksheet shows how to perform an adaptive evolution, that is, one where the parameters of the evolution are changed in response to some feature of the population.
;; **

;; @@
(ns algebolic.demo.adaptive
  (:require [gorilla-plot.core :as plot]
            [algebolic.expression.core :as expression]
            [algebolic.expression.tree :as tree]
            [algebolic.expression.genetics :as genetics]
            [algebolic.expression.score :as score]
            [algebolic.expression.render :as render]
            [algebolic.expression.interpreter :as interpreter]
            [algebolic.expression.mma :as mma]
            [algebolic.evolution.core :as evolution]
            [algebolic.evolution.metrics :as metrics]
            [algebolic.evolution.reproduction :as reproduction]
            [algebolic.evolution.scoring :as scoring]
            [algebolic.evolution.selection :as selection]
            [algebolic.evolution.transform :as transform]
            [algebolic.evolution.pareto :as pareto]
            [algebolic.algorithms.spea2 :as spea2]
            [criterium.core :as criterium]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Simple functions
;;; 
;;; We'll try fitting some functions with wiggles, which can be difficult because of local minima.
;; **

;; @@
(def xs (range 0.0 60.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.adaptive/coords</span>","value":"#'algebolic.demo.adaptive/coords"}
;; <=

;; @@
(def data (map (fn [x] (Math/sin (/ x 4))) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.adaptive/data</span>","value":"#'algebolic.demo.adaptive/data"}
;; <=

;; @@
;;(def data (map (fn [x] (+ (Math/sin (/ x 5)) (* 2 (Math/sin (/ x 3))) (* 3 (Math/sin (/ x 2))))) xs))
;; @@

;; @@
(def vars '[x])
(def functions (expression/get-functions #{:plus :minus :times}))
(def terminals (expression/terminal-generators vars))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.adaptive/terminals</span>","value":"#'algebolic.demo.adaptive/terminals"}
;; <=

;; **
;;; We define an initial generation-config. This is how the evolution will be driven at first. We will also define an adaptation function which (optionally) reconfigures the evolution after each generation.
;; **

;; @@
(def initial-gc
  (let [size-limit 250
        min-size 15
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 50
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 23}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 3) :repeat 4}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars (take 9 coords) (take 9 data) ex))}]
       {:ea-config              ea-config
        :transformations        [
                                 ;;(partial transform/apply-to-fraction-of-genotypes
                                 ;;         (partial transform/hill-descent
                                 ;;                  genetics/twiddle-constants
                                 ;;                  (:error score-functions))
                                 ;;         0.5)
                                 (partial transform/apply-to-all-genotypes
                                          (partial genetics/trim-hard size-limit))
                                 (partial transform/apply-to-all-genotypes
                                          (partial genetics/boost-hard min-size
                                                   #(genetics/random-full-tree functions terminals 3)))
                                  ]
        :score-functions        score-functions
        :reporting-function     (fn [z] (print ".") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.adaptive/initial-gc</span>","value":"#'algebolic.demo.adaptive/initial-gc"}
;; <=

;; **
;;; Our adaptation function will reveal more and more of the data as the run goes on. Here we'll reveal the data on a fixed, linear schedule for simplicity.
;; **

;; @@
(defn progressive-adapt
  [zg gc]
  (let [dat-length (count data)
        reveal-length (+ 10 (int (/ (:age zg) 300)))
        n (min dat-length reveal-length)
        ;;_ (println n)
        ]
    (assoc-in gc [:score-functions :error] (fn [ex] (score/abs-error vars (take n coords) (take n data) ex)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.adaptive/progressive-adapt</span>","value":"#'algebolic.demo.adaptive/progressive-adapt"}
;; <=

;; @@
(def initial-zeitgeist
  (evolution/make-zeitgeist (genetics/full-population functions terminals 50 7)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.adaptive/initial-zeitgeist</span>","value":"#'algebolic.demo.adaptive/initial-zeitgeist"}
;; <=

;; @@
(time (def result (evolution/run-evolution
                    initial-gc
                    initial-zeitgeist
                    (fn [zg gc] (>= (:age zg) 100))
                    progressive-adapt)))
